const HamburgerOpenMenu = () => (
  <div className="hamburger-menu-container">
    <div className="nested-menu-container">
      <p>ABOUT ME</p>
      <p>PORTFOLIO</p>
      <p>SKILLS</p>
      <p>CV</p>
    </div>

    {style}
  </div>
);

const style = (
  <style jsx>{`
    .hamburger-menu-container {
      background-color: var(--color1);
      height: 100vh;
      width: 100vw;
      position: absolute;
      left: 0;
      top: 0;
      display: flex;
      align-items: center;
      justify-content: center;
    }
    .nested-menu-container {
      background-color: white;
      height: 80%;
      width: 100%;
      padding: 2rem;
      margin: 2rem;
      font-size: 1.15rem;
      font-family: var(--font3);
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
    }
    .nested-menu-container > p {
      padding: 1rem;
    }
  `}</style>
);

export default HamburgerOpenMenu;
